    const stuff = ["металл", "дерево", "карбон"]

    const data = [
        material,
        mark,
        [' тип', 'марка']
    ]

    return (
        <NeedlesWrapper>
            <FilterBlock localData={data} />
            <MainContent>
                <BreadCamps />
                <CardItems />
            </MainContent>
        </NeedlesWrapper>
    )
}

